description:
Verenigde Staten
Drama / Komedie /Romantiek
90 minuten

een mooie film

met Michael Cera, Kat Dennings en Aaron Yoo

Nick (Michael Cera) en Norah (Kat Dennings) ontmoeten elkaar op een punk-concert. Hoewel ze behalve hun muzieksmaak niets gemeen 
hebben, vallen ze voor elkaar en zorgt de ontmoeting voor een bijzondere verandering in het leven van beide.
